function whois()
{
    return @json_decode(file_get_contents("http://ip-api.com/json/" . getIp()), true);
}

function logger($data, $reason)
{
    $today = date('l, d F H H:i:s');
    $visit = whois();
    $fopen = fopen("./bot_logs.txt", "a+") or die("Unable to open file!");
    $body = "ðŸ”¥ [ BLAZE ANTIBOT ] ðŸ”¥" . PHP_EOL;
    $body .= "REASON: {$reason} | CODE: " . uniqid() . PHP_EOL;
    $body .= "BOT: {$data}" . PHP_EOL;
    $body .= "DATE: {$today}" . PHP_EOL;
    $body .= "IP Address: " . getIP() . PHP_EOL;
    $body .= "COUNTRY: {$visit['country']}" . PHP_EOL;
    $body .= "REGION: {$visit['city']}" . PHP_EOL;
